import Login from "../users/Login";
import React, { useState } from 'react';
import Welcome from "../users/Welcome";

import 
{ BrowserRouter as Router, Routes, Route} 
    from "react-router-dom";


function Header() {
    // const [token, setToken] = useState();

    // if(!token) {
    //     return <Login setToken={setToken} />
    //   }

return (
    <header>
        <h1>Keeper</h1>
        <div className="header-class">
            <a href=
                {<Router>
                    <Routes>
                        <Route path="../users/Login" exact>
                            <Login/>
                            <link to="../users/Welcome">Already have an account? Login here!</link>
                        </Route>

                        <Route path="../users/Welcome" exact>
                            <Welcome/>
                            <link to="../users/Login">Already have an account? Login here!</link>
                        </Route>
                    </Routes>
                </Router>}>
                    Log In
            </a>
        </div>
    </header>
)};



export default Header;
